import React from 'react';
import { YAxis as RechartsYAxis } from 'recharts';

const YAxisWrapper = ({ label }) => {
  return (
    <RechartsYAxis
      label={{
        value: label,
        angle: -90,
        position: 'insideRight',
      }}
    />
  );
};

export default YAxisWrapper;
